script: |
  super -f text -I q11808.spq | sort > q11808.out

inputs:
  - name: q11808.spq
    data: |
      SELECT ALL - ( + - 17 ) + + col2 FROM tab2 (FORMAT parquet) cor0 WHERE NOT + col0 * 2 BETWEEN + col0 * + col0 AND + 16 * + + col2 + - ( - 42 ) + col2;
  - name: tab2

outputs:
  - name: q11808.out
    data: |
      40
      57
      75
